import React from "react";
import logo from "../img/logo.svg";
import sidbarMenu from "../ultis/menu";
import { NavLink } from "react-router-dom";

const SidebarLeft = () => {
  return (
    <div className="bg-slate-700  flex flex-col">
      <div className="w-full h-[70px] px-[25px] flex justify-start items-center">
        <img src={logo} className="w-[120px]  object-content" alt="logo" />
      </div>
      <div>
        {sidbarMenu.map((item) => (
          <NavLink
            to={item.path}
            className="py-2 px-[25px] flex items-center gap-2 font-semibold text-[#c7c6c6] no-underline hover:text-white"
          >
            <span>{item.icons}</span>
            <span>{item.test}</span>
          </NavLink>
        ))}
      </div>
    </div>
  );
};

export default SidebarLeft;
